import React from 'react';
import { Link } from 'react-router-dom';
import './HomePage.css';

const HomePage = () => {
  // 照片URL数组
  const photos = [
    'https://images.unsplash.com/photo-1599566150163-29194dcaad36?crop=faces&fit=crop&w=200&h=200',
    'https://images.unsplash.com/photo-1524504388940-b1c1722653e1?crop=faces&fit=crop&w=200&h=200',
    'https://images.unsplash.com/photo-1494790108377-be9c29b29330?crop=faces&fit=crop&w=200&h=200',
    // 可以添加更多照片URL
  ];

  return (
    <div className="homepage">
      <h1>People Museum</h1>
      <div className="photo-wall">
        {photos.map((photo, index) => (
          <img key={index} src={photo} alt={`Photo ${index + 1}`} className="photo" />
        ))}
      </div>
      <div className="buttons">
        <Link to="/add-persona">
          <button>Add Persona</button>
        </Link>
        <Link to="/add-collection">
          <button>Add Collection</button>
        </Link>
      </div>
    </div>
  );
}

export default HomePage;
